unsigned char* Drawer::LoadBitmapFile(char *filename, BITMAPINFOHEADER *bitmapInfoHeader)
{
	FILE *filePtr;	// 
	BITMAPFILEHEADER bitmapFileHeader;	// bitmap
	unsigned char	*bitmapImage;		// bitmap
	int	imageIdx = 0;		// 
	unsigned char	tempRGB;	// 

	// +filename 
	filePtr = fopen(filename, "rb");
	if (filePtr == NULL){
		printf("file not open\n");
		return NULL;
	}
	// bitmap
	fread(&bitmapFileHeader, sizeof(BITMAPFILEHEADER), 1, filePtr);
	// bitmap
	if (bitmapFileHeader.bfType != BITMAP_ID) {
		fprintf(stderr, "Error in LoadBitmapFile: the file is not a bitmap file\n");
		return NULL;
	}
	// bitmap
	fread(bitmapInfoHeader, sizeof(BITMAPINFOHEADER), 1, filePtr);
	// bitmap
	fseek(filePtr, bitmapFileHeader.bfOffBits, SEEK_SET);
	// 
	bitmapImage = new unsigned char[bitmapInfoHeader->biSizeImage];
	// 
	if (!bitmapImage) {
		fprintf(stderr, "Error in LoadBitmapFile: memory error\n");
		return NULL;
	}

	// bitmap
	fread(bitmapImage, 1, bitmapInfoHeader->biSizeImage, filePtr);
	// 
	if (bitmapImage == NULL) {
		fprintf(stderr, "Error in LoadBitmapFile: memory error\n");
		return NULL;
	}

	//bitmapBGRRBRGB
	for (imageIdx = 0;
		imageIdx < bitmapInfoHeader->biSizeImage; imageIdx += 3) {
		tempRGB = bitmapImage[imageIdx];
		bitmapImage[imageIdx] = bitmapImage[imageIdx + 2];
		bitmapImage[imageIdx + 2] = tempRGB;
	}
	// bitmap
	fclose(filePtr);

	printf("load BMP succeed!!!\n");
	return bitmapImage;
}

void Drawer::texload(int i, char *filename)
{

	BITMAPINFOHEADER bitmapInfoHeader;                                 // bitmap
	unsigned char*   bitmapData;                                       // 
	std::cout << "In texLoad :: " << filename << std::endl;					//
	bitmapData = LoadBitmapFile(filename, &bitmapInfoHeader);
	glBindTexture(GL_TEXTURE_2D, texture[i]);
	// /
	glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_NEAREST);
	glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_NEAREST);

	glTexImage2D(GL_TEXTURE_2D,
		0, 	    //mipmap() 
		GL_RGB,	//
		bitmapInfoHeader.biWidth, //n+2 
		bitmapInfoHeader.biHeight, //n+2 
		0, //(0=, 1=) 
		GL_RGB,	//bitmap
		GL_UNSIGNED_BYTE, //
		bitmapData);	//bitmap  
}

void Drawer::tex_init()
{
	glGenTextures(8, texture);
	texload(0, "tex2_binghu.bmp");
	texload(1, "tex2_red_binghu.bmp");
	texload(2, "sheet.bmp");
	texload(3, "woodfloor.bmp");
	texload(4, "rubber.bmp");
	texload(5, "blue.bmp");
	texload(6, "aud_c.bmp");
	texload(7, "aud_b.bmp");

}

void Drawer::Tex_Cube(GLfloat n)
{
	glPushMatrix();
	glScalef(n / 2, n / 2, n / 2);
	glBegin(GL_QUADS);
	glColor3f(1.0f,1.0f,1.0f);
	// Front Face
	//glTexCoord2f(0.0f, 0.0f);
	glNormal3f(0.0f,0.0f,1.0f);
	glVertex3f(-1.0f, -1.0f, 1.0f);  // Bottom Left Of The Texture and Quad
	//glTexCoord2f(1.0f, 0.0f);
	glVertex3f(1.0f, -1.0f, 1.0f);  // Bottom Right Of The Texture and Quad
	//glTexCoord2f(1.0f, 1.0f);
	glVertex3f(1.0f, 1.0f, 1.0f);  // Top Right Of The Texture and Quad
	//glTexCoord2f(0.0f, 1.0f);
	glVertex3f(-1.0f, 1.0f, 1.0f);  // Top Left Of The Texture and Quad
	// Back Face
	glNormal3f(0.0f,0.0f,-1.0f);
	glTexCoord2f(1.0f, 0.0f); glVertex3f(-1.0f, -1.0f, -1.0f);  // Bottom Right Of The Texture and Quad
	glTexCoord2f(1.0f, 1.0f); glVertex3f(-1.0f, 1.0f, -1.0f);  // Top Right Of The Texture and Quad
	glTexCoord2f(0.0f, 1.0f); glVertex3f(1.0f, 1.0f, -1.0f);  // Top Left Of The Texture and Quad
	glTexCoord2f(0.0f, 0.0f); glVertex3f(1.0f, -1.0f, -1.0f);  // Bottom Left Of The Texture and Quad
	// Top Face
	glNormal3f(0.0f,1.0f,0.0f);
	glTexCoord2f(0.0f, 1.0f); glVertex3f(-1.0f, 1.0f, -1.0f);  // Top Left Of The Texture and Quad
	glTexCoord2f(0.0f, 0.0f); glVertex3f(-1.0f, 1.0f, 1.0f);  // Bottom Left Of The Texture and Quad
	glTexCoord2f(1.0f, 0.0f); glVertex3f(1.0f, 1.0f, 1.0f);  // Bottom Right Of The Texture and Quad
	glTexCoord2f(1.0f, 1.0f); glVertex3f(1.0f, 1.0f, -1.0f);  // Top Right Of The Texture and Quad
	// Bottom Face
	glNormal3f(0.0f,-1.0f,0.0f);
	//glTexCoord2f(1.0f, 1.0f);
	glVertex3f(-1.0f, -1.0f, -1.0f);  // Top Right Of The Texture and Quad
	//glTexCoord2f(0.0f, 1.0f); 
	glVertex3f(1.0f, -1.0f, -1.0f);  // Top Left Of The Texture and Quad
	//glTexCoord2f(0.0f, 0.0f);
	glVertex3f(1.0f, -1.0f, 1.0f);  // Bottom Left Of The Texture and Quad
	//glTexCoord2f(1.0f, 0.0f); 
	glVertex3f(-1.0f, -1.0f, 1.0f);  // Bottom Right Of The Texture and Quad
	// Right face
	glNormal3f(1.0f,0.0f,0.0f);
	glTexCoord2f(1.0f, 0.0f); glVertex3f(1.0f, -1.0f, -1.0f);  // Bottom Right Of The Texture and Quad
	glTexCoord2f(1.0f, 1.0f); glVertex3f(1.0f, 1.0f, -1.0f);  // Top Right Of The Texture and Quad
	glTexCoord2f(0.0f, 1.0f); glVertex3f(1.0f, 1.0f, 1.0f);  // Top Left Of The Texture and Quad
	glTexCoord2f(0.0f, 0.0f); glVertex3f(1.0f, -1.0f, 1.0f);  // Bottom Left Of The Texture and Quad
	// Left Face
	glNormal3f(-1.0f,0.0f,0.0f);
	glTexCoord2f(0.0f, 0.0f); glVertex3f(-1.0f, -1.0f, -1.0f);  // Bottom Left Of The Texture and Quad
	glTexCoord2f(1.0f, 0.0f); glVertex3f(-1.0f, -1.0f, 1.0f);  // Bottom Right Of The Texture and Quad
	glTexCoord2f(1.0f, 1.0f); glVertex3f(-1.0f, 1.0f, 1.0f);  // Top Right Of The Texture and Quad
	glTexCoord2f(0.0f, 1.0f); glVertex3f(-1.0f, 1.0f, -1.0f);  // Top Left Of The Texture and Quad
	glEnd();
	glPopMatrix();
}

