void Drawer::Draw_Direction_Line(double theta)
{
	/*************** 2017.01.11 ***************/
	glEnable(GL_LINE_STIPPLE);
	glLineStipple(1, 0xAAAA);	//dashed
	glLineWidth(2);//

	glDisable(GL_LIGHTING);

	glBegin(GL_LINES);
	glColor3f(1, 0, 0);
	glNormal3f(0.0f, 0.0f, -1.0f);
	glVertex3f(0,0.8,7.5);
	glVertex3f(8*sin(theta+pi/2),0.8,7.5-8*cos(theta+pi/2));
	glEnd();
	/*************** 2017.01.11 ***************/
}

void Drawer::Draw_Force_Strip(double force){

	/*************** 2017.01.11 ***************/
	glDisable(GL_LINE_STIPPLE);
	glLineWidth(1.2);//
	glDisable(GL_DEPTH_TEST);
	glDisable(GL_LIGHTING);
	glColor3f(0, 1, 0);
	glMatrixMode(GL_PROJECTION);  // 
	glPushMatrix();               // 
	glLoadIdentity();             // 
	glOrtho(0, 100, 0, 100, -1, 1);    // 
	glMatrixMode(GL_MODELVIEW);   // Modelview
	glPushMatrix();               // 
	glLoadIdentity();             // 
	glRasterPos2f(90, 3);	
	drawString("Force");

	//
	glBegin(GL_LINES);	
	glNormal3f(0.0f, 0.0f, -1.0f);
	for(int i=0;i<10*force;i++)
	{
		float r = 1.0*i/25;
		float g = 2.0-1.0*i/25;
		if (r>1.0)r=1.0;
		if(g<0.0)g=0.0;
		
		glColor3f(r, g, 0);
		glVertex2f(88, 2+0.5*i);
		glVertex2f(88-0.2*i, 2+0.5*i);
	}
	glEnd();
	glMatrixMode(GL_PROJECTION);  // 
	glPopMatrix();                // 
	glMatrixMode(GL_MODELVIEW);   // Modelview
	glPopMatrix();                // 
	glEnable(GL_DEPTH_TEST);

	/*************** 2017.01.11 ***************/

}

