void Drawer::drawString( char* str) {
/*************** 2017.01.11 ***************/
	static int isFirstCall = 1;
	static GLuint lists;
	if (isFirstCall) { // 
		// ASCII
		isFirstCall = 0;
	
		// MAX_CHAR
		lists = glGenLists(MAX_CHAR);

		// 
		wglUseFontBitmaps(wglGetCurrentDC(), 0, MAX_CHAR, lists);
	}
	// 
	for (; *str != '\0'; ++str)
		glCallList(lists + *str);
}

void Drawer::Display(double s0, double s1, double friction)
{
	/*************** 2017.01.11 ***************/
	glColor3f(1.0f, 1.0f, 0.0f);     //  
	/*************** 2017.01.11 ***************/

	//force of friction
	static char buffer[256];
	/*************** 2017.01.11 ***************/
	sprintf(buffer, "team1:%d VS team 2:%d  ***friction:%.2f***",(int)s0,(int)s1,friction);
	/*************** 2017.01.11 ***************/
	char *c;
	glDisable(GL_DEPTH_TEST);
	/*************** 2017.01.11 ***************/
	glDisable(GL_LIGHTING);
	/*************** 2017.01.11 ***************/
	glMatrixMode(GL_PROJECTION);  // 
	glPushMatrix();               // 
	glLoadIdentity();             // 
	glOrtho(0, 480, 0, 480, -1, 1);    // 
	glMatrixMode(GL_MODELVIEW);   // Modelview
	glPushMatrix();               // 
	glLoadIdentity();             // 
	glRasterPos2f(20,20);
	for (c = buffer; *c != '\0'; c++) {
		glutBitmapCharacter(GLUT_BITMAP_HELVETICA_18, *c);
	}
	glMatrixMode(GL_PROJECTION);  // 
	glPopMatrix();                // 
	glMatrixMode(GL_MODELVIEW);   // Modelview
	glPopMatrix();                // 
	glEnable(GL_DEPTH_TEST);
}